def validate(actual, target):
    if isinstance(target, list):
        if len(actual) != len(target):
            return False
        for a, t in zip(actual, target):
            if not validate(a, t):
                return False
        return True
    else:
        return actual == target

def test_output(actual, target):
    print("target: {}".format(target))
    print("actual: {}".format(actual))
    if validate(actual, target):
        print(colored("Passed!", "green"))
        return True
    else:
        print(colored("Failed", "red"))
        return False

class Node():
    def __init__(self, children={}, val=None):
        self.children = children
        self.val = val

def Node():
    return defaultdict(Node)

def build_module_tree(powers):
    root = Node()

    for power in powers:
        module = power["Module"][1:]
        cur_node = root
        for key in module:
            cur_node = cur_node[key]
        cur_node["power"] = power

    return root

def build_tabel_row(values):
    html = "<tr>"

    for val in values:
        html += "<th>{}</th>".format(val)

    return html + "</tr>"

def build_html_table(scenario_names, power_rows):
    html = "<table>"
    title_val = ["Modules"] + scenario_names
    html += build_tabel_row(title_val)
    
    for row in power_rows:
        html += build_tabel_row(row)

    return html + "</table>"

def init_power_rows(powers):
    power_rows = []
    for power in powers:
        module = "/".join(power["Module"][1:])
        power = power["Total (mW)"]
        power_rows.append([module, power])
    return power_rows

def add_power(powers, power_rows):
    for i, power in enumerate(powers):
        power_rows[i].append(power["Total (mW)"])
    return

